	--     MinForce = 0, 
	--     MaxForceRot = 1, 
	--     MinForce2 = 2, 
	--     MaxForceRot2 = 3, 
	--     ForceNoRot = 4, 
	--     ForceRotPlusForce = 5 
	-- } 
	-- Research/documentation on the gtaforums can be found here https://gtaforums.com/topic/885669-precisely-define-object-physics/) and here https://gtaforums.com/topic/887362-apply-forces-and-momentums-to-entityobject/. 
	--  
	-- p6/relative - makes the xyz force not relative to world coords, but to something else 
	-- p7/highForce - setting false will make the force really low 
	--[[ void ]] ["APPLY_FORCE_TO_ENTITY_CENTER_OF_MASS"] = function(--[[Entity]] entity, --[[int]] forceType, --[[float]] x, --[[float]] y, --[[float]] z, --[[BOOL]] p5, --[[BOOL]] isDirectionRel, --[[BOOL]] isForceRel, --[[BOOL]] p8) Natives.InvokeVoid(0x18FF00FC7EFF559E, entity, forceType, 1.0*x, 1.0*y, 1.0*z, p5, isDirectionRel, isForceRel, p8) end, 
	-- Documented here: 
	-- gtaforums.com/topic/885669-precisely-define-object-physics/ 
	-- gtaforums.com/topic/887362-apply-forces-and-momentums-to-entityobject/ 
	--  
	-- forceFlags: 
	-- First bit (lowest): Strong force flag, factor 100 
	-- Second bit: Unkown flag 
	-- Third bit: Momentum flag=1 (vector (x,y,z) is a momentum, more research needed) 
	-- If higher bits are unequal 0 the function doesn't applay any forces at all. 
	-- (As integer possible values are 0-7) 
	--  
	-- 0: weak force 
	-- 1: strong force 
	-- 2: same as 0 (2nd bit?) 
	-- 3: same as 1 
	-- 4: weak momentum 
	-- 5: strong momentum 
	-- 6: same as 4 
	-- 7: same as 5 
	--  
	-- isLocal: vector defined in local (body-fixed) coordinate frame 
	-- isMassRel: if true the force gets multiplied with the objects mass (this is why it was known as highForce) and different objects will have the same acceleration. 
	--  
	-- p8 !!! Whenever I set this !=0, my script stopped. 
	--[[ void ]] ["APPLY_FORCE_TO_ENTITY"] = function(--[[Entity]] entity, --[[int]] forceFlags, --[[float]] x, --[[float]] y, --[[float]] z, --[[float]] offX, --[[float]] offY, --[[float]] offZ, --[[int]] boneIndex, --[[BOOL]] isDirectionRel, --[[BOOL]] ignoreUpVec, --[[BOOL]] isForceRel, --[[BOOL]] p12, --[[BOOL]] p13) Natives.InvokeVoid(0xC5F68BE9613E2D18, entity, forceFlags, 1.0*x, 1.0*y, 1.0*z, 1.0*offX, 1.0*offY, 1.0*offZ, boneIndex, isDirectionRel, ignoreUpVec, isForceRel, p12, p13) end, 
