PATHFIND = {

	-- When nodeEnabled is set to false, all nodes in the area get disabled. 
	-- `GET_VEHICLE_NODE_IS_SWITCHED_OFF` returns true afterwards. 
	-- If it's true, `GET_VEHICLE_NODE_IS_SWITCHED_OFF` returns false. 
	--[[ void ]] ["SET_ROADS_IN_AREA"] = function(--[[float]] x1, --[[float]] y1, --[[float]] z1, --[[float]] x2, --[[float]] y2, --[[float]] z2, --[[BOOL]] nodeEnabled, --[[BOOL]] unknown2) Natives.InvokeVoid(0xBF1A602B5BA52FEE, 1.0*x1, 1.0*y1, 1.0*z1, 1.0*x2, 1.0*y2, 1.0*z2, nodeEnabled, unknown2) end, 
	-- unknown3 is related to `SEND_SCRIPT_WORLD_STATE_EVENT > CNetworkRoadNodeWorldStateData` in networked environments. 
	-- See IS_POINT_IN_ANGLED_AREA for the definition of an angled area. 
	--[[ void ]] ["SET_ROADS_IN_ANGLED_AREA"] = function(--[[float]] x1, --[[float]] y1, --[[float]] z1, --[[float]] x2, --[[float]] y2, --[[float]] z2, --[[float]] width, --[[BOOL]] unknown1, --[[BOOL]] unknown2, --[[BOOL]] unknown3) Natives.InvokeVoid(0x1A5AA1208AF5DB59, 1.0*x1, 1.0*y1, 1.0*z1, 1.0*x2, 1.0*y2, 1.0*z2, 1.0*width, unknown1, unknown2, unknown3) end, 
	--[[ void ]] ["SET_PED_PATHS_IN_AREA"] = function(--[[float]] x1, --[[float]] y1, --[[float]] z1, --[[float]] x2, --[[float]] y2, --[[float]] z2, --[[BOOL]] p6, --[[Any]] p7) Natives.InvokeVoid(0x34F060F4BF92E018, 1.0*x1, 1.0*y1, 1.0*z1, 1.0*x2, 1.0*y2, 1.0*z2, p6, p7) end, 
	-- Flags are: 
	-- 1 = 1 = B02_IsFootpath 
	-- 2 = 4 = !B15_InteractionUnk 
	-- 4 = 0x20 = !B14_IsInterior 
	-- 8 = 0x40 = !B07_IsWater 
	-- 16 = 0x200 = B17_IsFlatGround 
	-- When onGround == true outPosition is a position located on the nearest pavement. 
	--  
	-- When a safe coord could not be found the result of a function is false and outPosition == Vector3.Zero. 
	--  
	-- In the scripts these flags are used: 0, 14, 12, 16, 20, 21, 28. 0 is most commonly used, then 16.  
	--  
	-- 16 works for me, 0 crashed the script. 
	--[[ BOOL (Bool) ]] ["GET_SAFE_COORD_FOR_PED"] = function(--[[float]] x, --[[float]] y, --[[float]] z, --[[BOOL]] onGround, --[[Vector3*]] outPosition, --[[int]] flags) return Natives.InvokeBool(0xB61C8E878A4199CA, 1.0*x, 1.0*y, 1.0*z, onGround, outPosition, flags) end, 
	-- https://gtaforums.com/topic/843561-pathfind-node-types 
	--[[ BOOL (Bool) ]] ["GET_CLOSEST_VEHICLE_NODE"] = function(--[[float]] x, --[[float]] y, --[[float]] z, --[[Vector3*]] outPosition, --[[int]] nodeFlags, --[[float]] p5, --[[float]] p6) return Natives.InvokeBool(0x240A18690AE96513, 1.0*x, 1.0*y, 1.0*z, outPosition, nodeFlags, 1.0*p5, 1.0*p6) end, 
	-- Get the closest vehicle node to a given position. 
	--[[ BOOL (Bool) ]] ["GET_CLOSEST_MAJOR_VEHICLE_NODE"] = function(--[[float]] x, --[[float]] y, --[[float]] z, --[[Vector3*]] outPosition, --[[float]] unknown1, --[[float]] unknown2) return Natives.InvokeBool(0x2EABE3B06F58C1BE, 1.0*x, 1.0*y, 1.0*z, outPosition, 1.0*unknown1, 1.0*unknown2) end, 
	-- p5, p6 and p7 seems to be about the same as p4, p5 and p6 for GET_CLOSEST_VEHICLE_NODE. p6 and/or p7 has something to do with finding a node on the same path/road and same direction(at least for this native, something to do with the heading maybe). Edit this when you find out more. 
	--  
	-- nodeType: 0 = main roads, 1 = any dry path, 3 = water 
	-- p6 is always 3.0 
	-- p7 is always 0 
	--  
	-- gtaforums.com/topic/843561-pathfind-node-types 
	--  
	-- Example of usage, moving vehicle to closest path/road: 
	-- Vector3 coords = ENTITY::GET_ENTITY_COORDS(playerVeh, true); 
	-- Vector3 closestVehicleNodeCoords;  
	-- float roadHeading;  
	-- PATHFIND::GET_CLOSEST_VEHICLE_NODE_WITH_HEADING(coords.x, coords.y, coords.z, &closestVehicleNodeCoords, &roadHeading, 1, 3, 0);  
	-- ENTITY::SET_ENTITY_HEADING(playerVeh, roadHeading); 
	-- ENTITY::SET_ENTITY_COORDS(playerVeh, closestVehicleNodeCoords.x, closestVehicleNodeCoords.y, closestVehicleNodeCoords.z, 1, 0, 0, 1); 
	-- VEHICLE::SET_VEHICLE_ON_GROUND_PROPERLY(playerVeh); 
	--  
