	--[[ void ]] ["TASK_GO_TO_COORD_WHILE_AIMING_AT_COORD"] = function(--[[Ped]] ped, --[[float]] x, --[[float]] y, --[[float]] z, --[[float]] aimAtX, --[[float]] aimAtY, --[[float]] aimAtZ, --[[float]] moveBlendRatio, --[[BOOL]] shoot, --[[float]] targetRadius, --[[float]] slowDistance, --[[BOOL]] useNavMesh, --[[int]] navFlags, --[[BOOL]] instantBlendToAim, --[[Hash]] firingPattern) Natives.InvokeVoid(0x11315AB3385B8AC0, ped, 1.0*x, 1.0*y, 1.0*z, 1.0*aimAtX, 1.0*aimAtY, 1.0*aimAtZ, 1.0*moveBlendRatio, shoot, 1.0*targetRadius, 1.0*slowDistance, useNavMesh, navFlags, instantBlendToAim, firingPattern) end, 
